            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">Positions: 2</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;</font></span></div>
            <div style="margin: 0in 0in 0pt"><font face="Calibri"><strong><span style="color: black">Key Responsibilities:</span></strong></font></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">* Base Clearcase + Multisite (both UNIX and Windows platform):</font></span></div>
