            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Base Clearcase + Multisite (both UNIX and Windows</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">platform): must be at clearcase administrator level and able to perform all</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">server administration/architecture/support/install, user support, multisite</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">replication, merging/branching, Vobs/Views administrations, Triggers,</font></span></div>
