            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">* UNIX: Ksh/Csh scripts(grep/awk/sed), vi/emacs, ssh/sshd,</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">crontab, and familiar w/ OS/Administration commands.</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;</font></span></div>
            <div style="margin: 0in 0in 0pt"><font face="Calibri"><strong><span style="color: black">Further Details:</span></strong></font></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;*InstallShield: know how to build software packages and upgrade path.</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *VBscript: know how to write scripts to interact w/ window services (ie. registry, etc)</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *Application Servers:&nbsp; know server processes and logging and able to trouble shoot process errors.</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *CruiseControl: understand continuous integration concept and setup build loops</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *Application + Software Source Code Version Control Management Provide/Perform Base Clearcase + Multisite Administration (including all</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">installation, configuration, patch, replication, server/client/user, process/procedure, etc. supports.) </font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *Provide/Perform Source Code Management according to SDLC and Release requirements (ie, branches, merges, etc...)</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *Application/Software Build Management:&nbsp; Create/Support Build Automation programs using Ant, InstallShield, Clearcase, and various </font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">compilers (vb, c, java, etc.) to create repeatable and auditable software &nbsp;packages.</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *Application/Software Deployment Management: &nbsp;Create/Perform Deployment Automation programs using Perl, MSI, Unix tars to deploy software</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">packages to various platforms (Unix/Windows) to all environments,</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></div>
            <div style="margin: 0in 0in 0pt"><font face="Calibri"><strong><span style="color: black">Skills and Knowledge:&nbsp;&nbsp;&nbsp; </span></strong></font></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Unix: 4+ years</font></span></div>
