            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Application Servers (Jboss, WebLogic, IIS, Tomcat, Iplanet) - 1+ years</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; CruiseControl: 1+ year</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;VBScript: 1+ years</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;</font></span></div>
            <div style="margin: 0in 0in 0pt"><font face="Calibri"><strong><span style="color: black">Hiring Manager is look for the following:</span></strong></font></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp; BASE Clearcase experience is primary requirement. The experience needs</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp; to be on both administration and deployment. In addition, they need to</font></span></div>
