            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp; We are a multi platform environment, Unix and Windows, so it is</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp; preferred that they have exposure to both, its fine if they favor one,</font></span></div>
            <div style="margin: 0in 0in 0pt"><span style="color: black"><font face="Calibri">&nbsp;&nbsp; but it helps to have both</font></span></div>
